import React from "react";
import 'bootstrap-icons/font/bootstrap-icons.css';



const Header = () => {
  return (
    <div className="row">
      <div className="col-12 bg-warning h-25">
        <div className="d-flex justify-content-between ">
          <img src="./logo512.png" alt="logo" height="75" width="75" />
          <span className="bg-danger">
            <i className="bi bi-list text-danger h-25 w-25"></i>
          </span>
          {/* <i class="bi bi-three-dots-vertical"></i> */}
          <span>
            {" "}
            <i className="bi bi-person-circle  text-danger h-25 w-25"></i>
          </span>
        </div>
      </div>
    </div>
  );
};

export default Header;
